import React from 'react';

export const Navbar: React.FC = () => {
  return (
    <div className='items-center'>
      <div className="p-10">
        <div>
          <a href="/">
            <h1 className="font-semibold text-white text-4xl" style={{ fontFamily: 'era', textAlign: 'center' }}>TAYLOR SWIFT: THE ERAS TOUR TRACKER</h1>
          </a>
          <h1 className="text-white text-xl" style={{ fontFamily: 'folklore', textAlign: 'center' }}>Click on the map markers to see the dates and shows for each!</h1>
        </div>
        <div className="absolute top-0 right-0 mt-3 mr-3">
          <a href="">
          <button
            className="bg-white rounded-full p-2"
            style={{ width: '40px', height: '40px', border: 'none', outline: 'none' }}
          >
            {/* Add your button icon or content here */}
          </button> </a>
        </div>
      </div>
    </div>
  );
}
